import React from 'react';
import http from "../http-common";

const getAll = () => {
    return http.get("/customers");
  };
  const get = id => {
    return http.get(`/customers/${id}`);
  };

const CustomerDataService =  {
    getAll,
    get,
};

export default CustomerDataService;
